INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 7001, "2030/12/17 14:59:59", 0, 1, 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "キャル", 7, 106001);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 7002, "2030/12/17 14:59:59", 0, 1, 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "コッコロ", 7, 105901);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 7003, "2030/12/17 14:59:59", 0, 1, 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "ペコリーヌ", 7, 105801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 10001, "2030/12/17 14:59:59", 0, 1, 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "ペコリーヌ", 10, 105801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 10002, "2030/12/17 14:59:59", 0, 1, 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "キャル", 10, 106001);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 10003, "2030/12/17 14:59:59", 0, 1, 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "コッコロ", 10, 105901);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 2104010, 0.0, 0.0, "2015/12/17 15:00:00", 10004, "2030/12/17 14:59:59", 0, 2, 1, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", "シェフィ", 10, 106401);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -416.5, 0, 0.0, 0.0, "2015/12/17 15:00:00", 12001, "2030/12/17 14:59:59", 0, 1, 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "ペコリーヌ", 12, 105801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 13001, "2030/12/17 14:59:59", 0, 1, 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "キャル", 13, 106001);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 13002, "2030/12/17 14:59:59", 0, 1, 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "コッコロ", 13, 105901);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 2104010, 0.0, 0.0, "2015/12/17 15:00:00", 13003, "2030/12/17 14:59:59", 0, 2, 1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "シェフィ", 13, 106401);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 13004, "2030/12/17 14:59:59", 0, 1, 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "ペコリーヌ", 13, 105801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 14001, "2030/12/17 14:59:59", 0, 1, 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "コッコロ", 14, 105901);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 2104010, 0.0, 0.0, "2015/12/17 15:00:00", 14002, "2030/12/17 14:59:59", 0, 2, 1, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "シェフィ", 14, 106401);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 14003, "2030/12/17 14:59:59", 0, 1, 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "ペコリーヌ", 14, 105801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 14004, "2030/12/17 14:59:59", 0, 1, 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "キャル", 14, 106001);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -470.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 15001, "2030/12/17 14:59:59", 0, 1, 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "コッコロ", 15, 105901);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 2104010, 0.0, 0.0, "2015/12/17 15:00:00", 16001, "2030/12/17 14:59:59", 0, 2, 1, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "シェフィ", 16, 106401);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 16002, "2030/12/17 14:59:59", 0, 1, 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "ペコリーヌ", 16, 105801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 16003, "2030/12/17 14:59:59", 0, 1, 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "キャル", 16, 106001);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 16004, "2030/12/17 14:59:59", 0, 1, 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "コッコロ", 16, 105901);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 17002, "2030/12/17 14:59:59", 0, 1, 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "コッコロ", 17, 105901);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 17004, "2030/12/17 14:59:59", 0, 1, 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", "キャル", 25, 106001);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 17005, "2030/12/17 14:59:59", 0, 1, 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", "コッコロ", 25, 105901);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 2104010, 0.0, 0.0, "2015/12/17 15:00:00", 17006, "2030/12/17 14:59:59", 0, 2, 1, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", "シェフィ", 25, 106401);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 17007, "2030/12/17 14:59:59", 0, 1, 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", "ペコリーヌ", 25, 105801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 18001, "2030/12/17 14:59:59", 0, 1, 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", "カリン", 18, 190801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (2, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 18002, "2030/12/17 14:59:59", 0, 1, 1, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", "カリン", 18, 190801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (3, -470.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 19001, "2030/12/17 14:59:59", 0, 1, 1, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", "カリン", 19, 190801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (4, -470.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 19002, "2030/12/17 14:59:59", 0, 1, 1, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", "カリン", 19, 190801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (5, -470.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 20001, "2030/12/17 14:59:59", 0, 1, 1, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", "カリン", 20, 190801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (6, -470.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 20002, "2030/12/17 14:59:59", 0, 1, 1, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", "カリン", 20, 190801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 21001, "2030/12/17 14:59:59", 0, 1, 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", "キャル", 21, 106001);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 21002, "2030/12/17 14:59:59", 0, 1, 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", "コッコロ", 21, 105901);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 2104010, 0.0, 0.0, "2015/12/17 15:00:00", 21003, "2030/12/17 14:59:59", 0, 2, 1, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", "シェフィ", 21, 106401);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 21004, "2030/12/17 14:59:59", 0, 1, 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", "ペコリーヌ", 21, 105801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -430.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 22001, "2030/12/17 14:59:59", 0, 1, 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", "カリン", 22, 190801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (2, -430.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 22002, "2030/12/17 14:59:59", 0, 1, 1, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", "カリン", 22, 190801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (3, -430.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 23001, "2030/12/17 14:59:59", 0, 1, 1, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", "カリン", 23, 190801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (4, -430.0, 0, 0.0, 0.0, "2015/12/17 15:00:00", 23002, "2030/12/17 14:59:59", 0, 1, 1, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", "カリン", 23, 190801);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -385.0, 0, 8.0, 4.08, "2019/01/31 12:00:00", 24001, "2030/12/17 14:59:59", 10011, 1, 2, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "エリコ（バレンタイン）", 24, 109001);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (2, -385.0, 0, 8.0, 5.0, "2019/01/31 12:00:00", 24002, "2030/12/17 14:59:59", 10011, 1, 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "エリコ（バレンタイン）", 24, 109001);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (3, -385.0, 0, 8.0, 10.11, "2019/01/31 12:00:00", 24003, "2030/12/17 14:59:59", 10011, 1, 2, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "エリコ（バレンタイン）", 24, 109001);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (4, -385.0, 0, 8.0, 4.0, "2019/01/31 12:00:00", 24004, "2030/12/17 14:59:59", 10011, 1, 2, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "エリコ（バレンタイン）", 24, 109001);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (5, -385.0, 0, 8.0, 6.0, "2019/01/31 12:00:00", 24005, "2030/12/17 14:59:59", 10011, 1, 2, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "エリコ（バレンタイン）", 24, 109001);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (6, 0.0, 0, 0.0, 0.0, "2019/01/31 12:00:00", 24006, "2030/12/17 14:59:59", 10011, 1, 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "エリコ（バレンタイン）", 24, 109002);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (7, 0.0, 0, 0.0, 0.0, "2019/01/31 12:00:00", 24007, "2030/12/17 14:59:59", 10011, 1, 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "エリコ（バレンタイン）", 24, 109002);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (8, 0.0, 0, 0.0, 0.0, "2019/01/31 12:00:00", 24008, "2030/12/17 14:59:59", 10011, 1, 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "エリコ（バレンタイン）", 24, 109002);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (9, 0.0, 0, 0.0, 0.0, "2019/01/31 12:00:00", 24009, "2030/12/17 14:59:59", 10011, 1, 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "エリコ（バレンタイン）", 24, 109002);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10, 0.0, 0, 0.0, 0.0, "2019/01/31 12:00:00", 24010, "2030/12/17 14:59:59", 10011, 1, 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "エリコ（バレンタイン）", 24, 109002);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -385.0, 0, 8.0, 2.12, "2019/01/31 12:00:00", 24011, "2030/12/17 14:59:59", 10011, 1, 2, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "シズル（バレンタイン）", 24, 109101);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (2, -385.0, 0, 8.0, 4.19, "2019/01/31 12:00:00", 24012, "2030/12/17 14:59:59", 10011, 5, 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "シズル（バレンタイン）", 24, 109101);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (3, -385.0, 0, 8.0, 2.3, "2019/01/31 12:00:00", 24013, "2030/12/17 14:59:59", 10011, 2, 4, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", "シズル（バレンタイン）", 24, 109101);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (4, 0.0, 0, 0.0, 0.0, "2019/01/31 12:00:00", 24014, "2030/12/17 14:59:59", 10011, 1, 1, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", "シズル（バレンタイン）", 24, 109102);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (5, -385.0, 0, 8.0, 5.23, "2019/01/31 12:00:00", 24015, "2030/12/17 14:59:59", 10011, 5, 2, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", "シズル（バレンタイン）", 24, 109101);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (6, 0.0, 0, 0.0, 0.0, "2019/01/31 12:00:00", 24016, "2030/12/17 14:59:59", 10011, 1, 1, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", "シズル（バレンタイン）", 24, 109102);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (7, -385.0, 0, 8.0, 5.01, "2019/01/31 12:00:00", 24017, "2030/12/17 14:59:59", 10011, 1, 2, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", "シズル（バレンタイン）", 24, 109101);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (8, 0.0, 0, 0.0, 0.0, "2019/01/31 12:00:00", 24018, "2030/12/17 14:59:59", 10011, 1, 1, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", "シズル（バレンタイン）", 24, 109102);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (9, 0.0, 0, 0.0, 0.0, "2019/01/31 12:00:00", 24019, "2030/12/17 14:59:59", 10011, 1, 1, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "シズル（バレンタイン）", 24, 109102);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (10, 0.0, 0, 0.0, 0.0, "2019/01/31 12:00:00", 24020, "2030/12/17 14:59:59", 10011, 1, 1, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", "シズル（バレンタイン）", 24, 109102);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -363.0, 2104010, 0.0, 0.0, "2015/12/17 15:00:00", 26001, "2030/12/17 14:59:59", 0, 2, 1, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", "シェフィ", 26, 106401);
