INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -416.5, 0, 0.0, 0.0, "2015/12/17 15:00:00", 43004, "2030/12/17 14:59:59", 0, 1, 1, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", "アメス", 44, 123001);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (2, -416.5, 0, 0.0, 0.0, "2015/12/17 15:00:00", 43005, "2030/12/17 14:59:59", 0, 1, 1, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", "アメス", 44, 123001);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (3, -416.5, 0, 0.0, 5.79, "2015/12/17 15:00:00", 43006, "2030/12/17 14:59:59", 0, 1, 2, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", "アメス", 45, 123001);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -371.5, 0, 0.0, 0.0, "2015/12/17 15:00:00", 46001, "2030/12/17 14:59:59", 0, 1, 1, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", "アメス", 46, 123001);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -416.5, 0, 0.0, 0.0, "2015/12/17 15:00:00", 47001, "2030/12/17 14:59:59", 0, 2, 2, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", "シズル", 47, 104901);
INSERT INTO `v1_b55f2a70a2a565e196f77ba060395f63fe5243ebd3ec03e712d4407cfec65c03` VALUES (1, -416.5, 0, 0.0, 9.32, "2015/12/17 15:00:00", 47002, "2030/12/17 14:59:59", 0, 1, 2, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", "リノ", 47, 101101);
